Sometimes it takes two guys to spoil a virgin, and these two certainly make a good job of spoiling Wendy. She\'s waited for this moment for many years and now that she\'s 18 years old and ready to let it go she wants it to be something special. Well, little does she know that these two young men are certainly going to make it special; however they don\'t promise that it will be all that pleasant; for Wendy that is!
